import { useState } from "react";


const Component1 = () =>{
    const [count, setCount] = useState(0);
    const [countSecond, setCountSecond] = useState(0)

    return(
        <>
         <p>Вы кликнули {count} раз</p>
        <button onClick={() => setCountSecond(countSecond + 1)}>
          Кликни меня!
        </button>
        </>
    )
}


export default Component1
